import React from "react";
import { useNavigate } from "react-router-dom";
import {
  Upload,
  Check,
  Calendar,
  ArrowRight,
  Bell,
  Plus,
  Settings,
} from "lucide-react";

const WorkflowAutomationPage: React.FC = () => {
  const navigate = useNavigate();

  const workflows = [
    {
      name: "File Uploads",
      description: "Trigger automation whenever a new file is uploaded.",
      color: "from-blue-500 to-indigo-500",
      icon: <Upload className="w-6 h-6 text-white" />,
      route: "/files",
    },
    {
      name: "Task Assignment",
      description: "Assign tasks to the right team members automatically.",
      color: "from-green-500 to-emerald-500",
      icon: <Check className="w-6 h-6 text-white" />,
      route: "/tasks",
    },
    {
      name: "Meeting Reminders",
      description: "Send timely reminders before every scheduled meeting.",
      color: "from-purple-500 to-pink-500",
      icon: <Calendar className="w-6 h-6 text-white" />,
      route: "/meetings",
    },
    {
      name: "Status Updates",
      description: "Sync project or task statuses automatically across tools.",
      color: "from-orange-500 to-yellow-500",
      icon: <Settings className="w-6 h-6 text-white" />,
      route: "/workflows/status-updates",
    },
  ];

  return (
    <div className="min-h-screen bg-gradient-to-br from-gray-50 via-white to-gray-100 p-10">
      {/* Header */}
      <header className="flex justify-between items-center mb-12">
        <div>
          <h1 className="text-4xl font-bold text-gray-800">Workflow Automation</h1>
          <p className="text-gray-500 text-sm mt-2 max-w-lg">
            Simplify your operations by automating repetitive tasks and keeping your team connected across workflows.
          </p>
        </div>
        <div className="flex items-center gap-4">
          <Bell className="w-5 h-5 text-gray-500 hover:text-gray-700 transition" />
          <div className="w-10 h-10 bg-gradient-to-r from-blue-500 to-indigo-500 rounded-full flex items-center justify-center text-white font-semibold shadow">
            AS
          </div>
        </div>
      </header>

      {/* Add Workflow Button */}
      <div className="flex justify-between items-center mb-10">
        <button
          onClick={() => navigate("/workflows/add")}
          className="flex items-center gap-2 bg-gradient-to-r from-blue-600 to-indigo-600 text-white px-5 py-2.5 rounded-lg text-sm font-medium shadow hover:shadow-lg hover:scale-[1.03] transition"
        >
          <Plus className="w-4 h-4" />
          New Workflow
        </button>

        <div className="text-sm text-gray-500">
          Total Workflows: <span className="font-semibold text-gray-700">{workflows.length}</span>
        </div>
      </div>

      {/* Workflow Grid */}
      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 xl:grid-cols-4 gap-8">
        {workflows.map((flow) => (
          <div
            key={flow.name}
            onClick={() => navigate(flow.route)}
            className="group relative bg-white rounded-2xl border border-gray-100 shadow-sm hover:shadow-xl hover:border-gray-200 transition-all duration-300 p-6 cursor-pointer overflow-hidden"
          >
            {/* Decorative background circle */}
            <div
              className={`absolute -top-4 -right-4 w-24 h-24 rounded-full opacity-10 bg-gradient-to-br ${flow.color}`}
            ></div>

            {/* Icon */}
            <div
              className={`w-12 h-12 rounded-xl bg-gradient-to-br ${flow.color} flex items-center justify-center mb-4 shadow-sm`}
            >
              {flow.icon}
            </div>

            {/* Title and Description */}
            <h3 className="text-gray-800 font-semibold text-lg mb-2">{flow.name}</h3>
            <p className="text-sm text-gray-500 mb-6 leading-snug">{flow.description}</p>

            {/* View Details */}
            <div className="flex items-center text-sm font-medium text-indigo-600 group-hover:text-indigo-700 group-hover:translate-x-1 transition-all">
              View Details
              <ArrowRight className="w-4 h-4 ml-1" />
            </div>
          </div>
        ))}
      </div>

      {/* Footer */}
      <footer className="mt-16 text-center text-gray-400 text-xs">
        Collabryta © {new Date().getFullYear()} — Powered by AI-driven collaboration tools.
      </footer>
    </div>
  );
};

export default WorkflowAutomationPage;
